using AiCashGuard.Constants;
using AiCashGuard.Model.Internal.Transaction;
using AiCashGuard.UserControls.Layouts_rows;
using System.Collections.Generic;
using System.Windows.Forms;

namespace AiCashGuard.Forms.TransactionModule
{
	public partial class BulkScanScreen : BaseForm
	{
		private  List<BulkScanModel> allTransactions = new List<BulkScanModel>();
		public BulkScanScreen()
		{

			InitializeComponent();
			allTransactions = new List<BulkScanModel>
			{
				new BulkScanModel {Id = 1, Amount = "Approved" ,Date = "12/12/24", CheckImage = ""},
				new BulkScanModel {Id = 2, Amount = "Approved" ,Date = "12/12/24", CheckImage = ""}
			};
			DisplayTransactions(allTransactions);


			BaseTableLayoutPanel.Controls.Add(this.BackPanel, 0, 1); // Row 1 for dashboardPanel
		}

		private void panel3_Paint(object sender, PaintEventArgs e)
		{

		}

		public  void RemoveItem(int Id)
		{
			allTransactions.Remove(allTransactions.Find(x => x.Id == Id));
			DisplayTransactions(allTransactions);
			MessageBox.Show("Item Removed" + Id);
		}


		private void DisplayTransactions(List<BulkScanModel> transactions)
		{
			BulkRowPanel.Controls.Clear();
			BulkRowPanel.RowCount = 0;
			BulkRowPanel.RowStyles.Clear();
			foreach (var transaction in transactions)
			{
				var TransactionRow = new TransactionBulkScan_row(this);
				TransactionRow.LoadTransaction(transaction);
				TransactionRow.Margin = new Padding(0);
				TransactionRow.Dock = DockStyle.Top;
				BulkRowPanel.RowCount++;
				BulkRowPanel.RowStyles.Add(new RowStyle(SizeType.AutoSize));
				BulkRowPanel.Controls.Add(TransactionRow, 0, BulkRowPanel.RowCount - 1);
			}
			BulkRowPanel.Padding = new Padding(0);
			BulkRowPanel.Margin = new Padding(0);
		}
		private void BulkRowPanel_Paint(object sender, PaintEventArgs e)
		{

		}

		private void BulkRowPanel_Paint_1(object sender, PaintEventArgs e)
		{

		}
	}
}
